import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>
          Edit <code>src/App.tsx</code> and save to reload.
        </h1>
      </header>
    </div>
  );
}

export default App;
